import '../App.css'
import {Link} from 'react-router-dom'

export const Buscador= ()=>
{
    let valorBuscador='';
    let valorFiltro='';


    return(
        <div className='buscador'>
            <input type='text' className='buscadorInput' onChange={
                (e)=>
                {
                    valorBuscador= e.target.value;
                }
            }/>
            <select type='criterio' className='buscadorCriterio'>
                <option></option>
                <option>Vivienda</option>
                <option>Renta</option>
            </select>
            <Link to={'/buscar'}><input type='button'  className='buscarBoton' value={'buscador'} onClick={
                ()=>
                {
                    alert(valorBuscador);
                }
            }/></Link>
        </div>
    )
}
